import React from 'react';
import PropTypes from 'prop-types';

const Name = (props) => {
    let {userName, age} = props;
    
    return (
        <div className="row mt-2">
            <label for={userName}>Name</label>
            <input id="name" className="col-9 form-control" type="text" />
      </div>
    );
};

Name.propTypes = {
    
};

export default Name;
